import {Parallax, ParallaxProvider} from 'react-scroll-parallax';
import {Poem, Stanza} from './Poem'

import './App.css';
import './aos.css';
import 'aos/dist/aos.css';

import dafyddLink from './images/Dafydd.jpg';


class App extends Component {
  componentDidMount() {
    AOS.init({offset: 0, delay: 0, duration: 300})
  }

  render() {
    return (
      <div>
        <Title/>
        <Poem>
          <Stanza>
            <p> I love dick <br/> dick loves me </p>
          </Stanza>
        </Poem>
      </div>
    );
  }
}


class Title extends Component {
  constructor(props) {
    super(props);
    this.id = nextId();
    console.log(this.id);
  }

  render() {
    return (
      <div className="Title">
        <div className="TitleAnchor" id={"Anchor"+this.id}/>
        <h1 className="TitleText" data-aos="title-off" data-aos-anchor={"#Anchor"+this.id} data-aos-anchor-placement="top-top">
          MAGDALEN BALL
        </h1>
      </div>
    );
  }
}

class Tickets extends Component {
  render() {
    return (
      <div className="TicketsContainer">
      </div>
    );
  }
}

export default App;
